import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import GameDashboard from './components/GameDashboard';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/game/:username" component={GameDashboard} />
        <Route path="/" exact>
          <h1>Welcome to the Bingo Game App</h1>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
